import React, { Component } from 'react';
import './Toolbar.css';

export default class Toolbar extends Component {
  render() {
    return (
      <ul className="todo-list__toolbar">
        <li>DONE</li>
        <li>EDIT</li>
        <li>REMOVE</li>
      </ul>
    )
  }
}
